import React from "react";
import { Link } from "react-router-dom";

function Navigation(props) {
    let navClasses = 'Header-Nav';
    if (props.navigationOpen) {
        navClasses = "Header-Nav Open"
    }
    return (
        <nav className={navClasses}>
            <ul className="Header-Nav-List" onClick={props.handleClick}>
                <li><Link to="/" className="Nav-List-Item">Home</Link></li>
                <li><Link to="/tools" className="Nav-List-Item">Tools</Link></li>
                <li><Link to="/about" className="Nav-List-Item">About</Link></li>
            </ul>
        </nav>
    );
}

export default Navigation;
